                    retval.Version2 = reader.GetUInt16();
                    break;
                case "VersionControl":
                    retval.VersionControl = reader.GetUInt32();
                    break;
                case "Weight":
                    retval.Weight = reader.GetSingle();
                    break;
                default:
                    reader.Skip();
                    break;
            }
        }
        return retval;
    }
}
